member.summary:
 Helper function to append an  to a . Calling
  directly causes an allocation by first converting the
  to a string and then appending that result:
 
 public StringBuilder Append(int value)
 {
     return Append(value.ToString(CultureInfo.CurrentCulture));
 }
 

 Note that this uses the current culture to do the conversion while  does
 not do any cultural sensitive conversion.

example.code:
 IList<string> list = ...;

 foreach (string item in list.NoAllocEnumerate())
 {
     // ...
 }

 IEnumerable<string> source = ...;

 foreach (string item in source.NoAllocEnumerate())
 {
     // ...
 }

 IDictionary<string, string> dictionary = ...;

 foreach ((string key, string value) in dictionary.NoAllocEnumerate())
 {
     // ...
 }
